import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <div>
          Cooper's Coolcast
        </div>
      </header>
      <body className="App-body">
        <div className="column">
          Coolcast Promos,
        </div>
        <div>
          Recommended things,
        </div>
        <div className="column">
          Upcoming events,
        </div>
        <div>
          Etc.
        </div>
      </body>
    </div>
  );
}

export default App;
